import React, { Component } from "react";
import { connect } from "react-redux";
import {Table} from "react-materialize"
import API from "../../utils/API/API";
function mapStateToProps(state) {
  return {};
}

class ProjectTable extends Component {

  componentDidMount(){
    if(this.props.business){
      const businessId = this.props.business
      API.get(`/project/${businessId}`).then(response => {
        console.log(response.data)
      }).catch(error => {
        console.log(error)
      })
    }
  }

  render() {
    return (
      <Table >
        <thead>
          <tr>
            <th data-field="id">Project Name</th>
            <th data-field="name">Price</th>
            <th data-field="price">Status</th>
            <th data-field="price">Start Date</th>
            <th data-field="price">Completed Date</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td><a href="#">Restaurant Web</a></td>
            <td>200.00</td>
            <td>Pending</td>
            <td>Jan 15, 2020</td>
            <td>Feb 15, 2020</td>
          </tr>
          <tr>
            <td><a href="#">Alvin</a></td>
            <td>200.00</td>
            <td>Completed</td>
            <td>Jan 15, 2020</td>
            <td>Feb 15, 2020</td>
          </tr>
          <tr>
            <td><a href="#">Restaurant Web</a></td>
            <td>200.00</td>
            <td>Completed</td>
            <td>Jan 15, 2020</td>
            <td>Feb 15, 2020</td>
          </tr>
        </tbody>
      </Table>
    );
  }
}

export default connect(mapStateToProps)(ProjectTable);
